import DefaultLayout from './layouts/DefaultLayout';
import Home from './components/Ulap/Home';
import ProductFinder from './components/Ulap/ProductFinder/ProductFinder';

const routes = [
  {
    path: '/',
    element: DefaultLayout,
    children: [
      { path: '/', element: Home },
      { path: '/product-finder', element: ProductFinder },
    ],
  },
];

export default routes;
